INSERT INTO `wp_cjtoolbox_block_files` ( `id`, `blockId`, `name`, `type`, `description`, `code`, `order`, `tag`) VALUES
(1, 1, 'Master', NULL, NULL, '<style type="text/css"> \n.map{\n		width: 283px;\n	height: 597px;\n	background: url(wp-content/uploads/2017/05/tn.png)left top no-repeat;\n	position: relative;\n\n\n}\n.bg{\n	\n	width: 1000px\n	height:597px;\n\n}\n.map .overlay{\n    		width: 283px;\n	height: 597px;\n	background: url(wp-content/uploads/2017/05/tn.png)  283px top no-repeat;\n	position: absolute;\n\n	top:0;\n	left: 0;\n		z-index: 1;\n}\n.map img{\n	position: absolute;\n	top:0;\n	left: 0;\n	z-index: 2;\n}\n\n.map .tooltip{\n	position: fixed;\n	border-radius: 50px;\n	color: #FFF;\n	background: #000;\n	padding: 0 10px;\n	display: inline;\n	top:0;\n	left: 0;\n	z-index: 3;\n	text-align: center;\n}\n   </style> ', 0, NULL),
(1, 3, 'Master', NULL, NULL, '\n    <script type="text/javascript">\n    jQuery(function($){\n      $(\'.map\').append(\'<div class="overlay">\').append(\'<div class="tooltip">hello<div>\');\n      $(\'.map .tooltip\').hide();\n      var region=[\n      {name:\'North\',slug:\'north\'},\n      {name:\'Tunis\',slug:\'tunis\'},\n      {name:\'Cap-Bon\',slug:\'capbon\'},\n      {name:\'Sahel\',slug:\'sahel\'},\n      {name:\'Middle\',slug:\'middle\'},\n      {name:\'North-West\',slug:\'northwest\'},\n      {name:\'South\',slug:\'south\'},\n      {name:\'Dejrba\',slug:\'dejreba\'}\n      ];\n      var image=[\'wp-content/uploads/2017/05/1.jpg\',\'wp-content/uploads/2017/05/2.jpg\',\'wp-content/uploads/2017/05/3.jpg\',\'wp-content/uploads/2017/05/4.jpg\',\'wp-content/uploads/2017/05/5.jpg\',\'wp-content/uploads/2017/05/6.jpg\',\'wp-content/uploads/2017/05/7.jpg\',\'wp-content/uploads/2017/05/8.jpg\'];\n      // tooltip\n      $(document).mousemove(function(e){\n        $(\'.map .tooltip\').css({\n          top:e.clientY-$(\'.map .tooltip\').height()-50,\n          left:e.clientX-$(\'.map .tooltip\').width()/2-10\n        });\n      });\n      //region\n      $(\'.map area\').mouseover(function(){\n        var index=$(this).index();\n        var left=-index*283-283;\n        $(\'.map .tooltip\').html(region[index].name).stop().fadeTo(500,1);\n        $(\'.bg\').css(\'background-image\',\'url(\'+image[index]+\')\');\n        $(\'.map .overlay\').css({\n          backgroundPosition : left+"px 0px"\n        });\n      });\n      //sort\n      $(\'.map\').mouseout(function(){\n        $(\'.map .overlay\').css({\n          backgroundPosition:"283px 0px"\n        });\n        $(\'.bg\').css(\'background-image\',\'url(void.png)\');\n         $(\'.map .tooltip\').stop().fadeTo(500,0);       \n      }) ;\n    });\n  </script>\n  \n  \n  ', 0, NULL),
