 else {\n\n						if(interstitialIndex>2) {\n\n							interstitialIndex -= 1;\n							interstitialScroll(parseInt(heights[index])+($window.height()*interstitialIndex));\n\n						} else {\n\n							interstitialIndex = 1;\n							interstitialScroll(parseInt(heights[index]));\n						}\n					}\n\n				}\n			},\n			init: function() {\n				if (document.addEventListener && settings.touchScroll) {\n					document.addEventListener(\'touchstart\', swipeScroll.touchHandler, false);\n					document.addEventListener(\'touchmove\', swipeScroll.touchHandler, false);\n					document.addEventListener(\'touchend\', swipeScroll.touchHandler, false);\n				}\n			}\n		};\n\n\n		util = {\n			refresh:function(withCallback,scroll) {\n				clearTimeout(timeoutId2);\n				timeoutId2 = setTimeout(function() {\n					//retain position\n					sizePanels(true);\n					//scroll, firstLoad\n					calculatePositions(scroll,false);\n					if(withCallback) {\n							settings.afterResize();\n					}\n				},400);\n			},\n			handleUpdate:function() {\n				//callbacks, scroll\n				//changed from false,true to false,false\n				util.refresh(false,false);\n			},\n			handleResize:function() {\n				//callbacks, scroll\n				util.refresh(true,false);\n			},\n			handleOrientation:function() {\n				//callbacks, scroll\n				util.refresh(true,true);\n			}\n		};\n		settings = $.extend(settings, options);\n\n		//retain position\n		sizePanels(false);\n\n		calculatePositions(false,true);\n\n		if(true===hasLocation) {\n			//index, instant, callbacks, toTop\n			animateScroll(index,false,true,true);\n		} else {\n			setTimeout(function() {\n				//instant,callbacks\n				manualScroll.calculateNearest(true,false);\n			},200);\n		}\n		if(heights.length) {\n			manualScroll.init();\n			swipeScroll.init();\n\n			$window.on("resize",util.handleResize);\n			if (document.addEventListener) {\n				window.addEventListener("orientationchange", util.handleOrientation, false);\n			}\n		}\n		function interstitialScroll(pos) {\n			if( $().velocity ) {\n				$(settings.target).stop().velocity(\'scroll\', {\n					duration: settings.scrollSpeed,\n					easing: settings.easing,\n					offset: pos,\n					mobileHA: false\n				});\n			} else {\n				$(settings.target).stop().animate({\n					scrollTop: pos\n				}, settings.scrollSpeed,settings.easing);\n			}\n		}\n\n		function sizePanels(keepPosition) {\n			if(keepPosition) {\n				top = $window.scrollTop();				\n			}\n\n			var selector = settings.section;\n			overflow = [];\n			if(settings.interstitialSection.length) {\n				selector += "," + settings.interstitialSection;\n			}\n			if(settings.scrollbars===false) {\n				settings.overflowScroll = false;\n			}\n			$(selector).each(function(i) {\n				var $this = $(this);\n\n				if(settings.setHeights) {\n					if($this.is(settings.interstitialSection)) {\n						overflow[i] = false;\n					} else {\n						if(($this.css("height","auto").outerHeight()<$window.height()) || $this.css("overflow")==="hidden") {\n							$this.css({"height":$window.height()});\n\n							overflow[i] = false;\n						} else {\n							\n							$this.css({"height":$this.height()});\n\n							if(settings.overflowScroll) {\n								overflow[i] = true;\n							} else {\n								overflow[i] = false;\n							}\n						}\n\n					}\n\n				} else {\n\n					if(($this.outerHeight()<$window.height()) || (settings.overflowScroll===false)) {\n						overflow[i] = false;\n					} else {\n						overflow[i] = true;\n					}\n				}\n			});\n			if(keepPosition) {\n				$window.scrollTop(top);\n			}\n		}\n		function calculatePositions(scroll,firstLoad) {\n			var selector = settings.section;\n			if(settings.interstitialSection.length) {\n				selector += "," + settings.interstitialSection;\n			}\n			heights = [];\n			names = [];\n			elements = [];\n			$(selector).each(function(i){\n					var $this = $(this);\n					if(i>0) {\n						heights[i] = parseInt($this.offset().top) + settings.offset;\n					} else {\n						heights[i] = parseInt($this.offset().top);\n					}\n					if(settings.sectionName && $this.data(settings.sectionName)) {\n						names[i] = "#" + $this.data(settings.sectionName).toString().replace(/ /g,"-");\n					} else {\n						if($this.is(settings.interstitialSection)===false) {\n							names[i] = "#" + (i + 1);\n						} else {\n							names[i] = "#";\n							if(i===$(selector).length-1 && i>1) {\n\n								heights[i] = heights[i-1]+(parseInt($($(selector)[i-1]).outerHeight())-parseInt($(window).height()))+parseInt($this.outerHeight());\n							}\n						}\n					}\n					elements[i] = $this;\n					try {\n						if($(names[i]).length && window.console) {\n							console.warn("Scrollify warning: Section names can\'t match IDs - this will cause the browser to anchor.");\n						}\n					} catch (e) {}\n\n					if(window.location.hash===names[i]) {\n						index = i;\n						hasLocation = true;\n					}\n\n			});\n\n			if(true===scroll) {\n				//index, instant, callbacks, toTop\n				animateScroll(index,false,false,false);\n			}\n		}\n\n		function atTop() {\n			if(!overflow[index]) {\n				return true;\n			}\n			top = $window.scrollTop();\n			if(top>parseInt(heights[index])) {\n				return false;\n			} else {\n				return true;\n			}\n		}\n		function atBottom() {\n			if(!overflow[index]) {\n				return true;\n			}\n			top = $window.scrollTop();\n\n			if(top<parseInt(heights[index])+(elements[index].outerHeight()-$window.height())-28) {\n\n				return false;\n\n			} else {\n				return true;\n			}\n		}\n	}\n\n	function move(panel,instant) {\n		var z = names.length;\n		for(;z>=0;z--) {\n			if(typeof panel === \'string\') {\n				if (names[z]===panel) {\n					index = z;\n					//index, instant, callbacks, toTop\n					animateScroll(z,instant,true,true);\n				}\n			} else {\n				if(z===panel) {\n					index = z;\n					//index, instant, callbacks, toTop\n					animateScroll(z,instant,true,true);\n				}\n			}\n		}\n	}\n	scrollify.move = function(panel) {\n		if(panel===undefined) {\n			return false;\n		}\n		if(panel.originalEvent) {\n			panel = $(this).attr("href");\n		}\