(529, 'CJTStatisticsMetaboxModel.latestscripts', 'a:4:{s:4:"time";i:1497966603;s:7:"scripts";a:2:{i:0;a:4:{s:5:"title";s:12:"Image Zoomer";s:4:"link";s:55:"http://css-javascript-toolbox.com/scripts/image-zoomer/";s:11:"description";s:384:"This script extension plugin allows you to add a zoom functionality to your images. It is powerful, easy to configure, and features a stack of image zoom options. There is no need to manually enter shortcode parameters, and all the field parameters in the shortcode form contains help text. <a href="http://css-javascript-toolbox.com/script-extensions/image-zoomer/">Read More ...</a>";s:7:"pubDate";s:31:"Tue, 09 Sep 2014 10:39:10 +0000";}i:1;a:4:{s:5:"title";s:26:"Black & White Image Effect";s:4:"link";s:67:"http://css-javascript-toolbox.com/scripts/black-white-image-effect/";s:11:"description";s:592:"This CJT extension plugin is based on the powerful light-weight jQuery script by Gianluca Guarini can easily convert any coloured image into a black and white greyscale image. This is the second edition that now provides shortcode form support and image uploading/selecting. It has never been easier to add cool black and white effect images on your website. There is no need to manually enter shortcode parameters, and all the field parameters in the shortcode form contains help text. <a href="http://css-javascript-toolbox.com/script-extensions/black-white-image-effect/">Read More ...</a>";s:7:"pubDate";s:31:"Mon, 08 Sep 2014 03:04:59 +0000";}}s:10:"extensions";a:7:{i:0;a:4:{s:5:"title";s:14:"WP Core Editor";s:4:"link";s:60:"http://css-javascript-toolbox.com/extensions/wp-core-editor/";s:11:"description";s:337:"Please Note This feature is now 100% free in the WordPress.org plugin repository. Thanks The WP Core Editor extension plugin for CJT gives you all the tools for editing WordPress core files. If you need to quickly make changes to your wp-config.php file or adjust some security policies in your .htaccess file, then this plugin [&#823