(95, 1, '2017-06-11 19:56:03', '2017-06-11 19:56:03', '[vc_row][vc_column][vc_empty_space][vc_custom_heading text="Bizerte" font_container="tag:h2|text_align:center"][/vc_column][/vc_row][vc_row][vc_column][vc_custom_heading text="Bizerte , the smiling coast of Tunisia :" font_container="tag:h4|text_align:center"][vc_column_text]\r\n<p style="text-align: center;">On the coast of Tunisia , Bizerte, sentinel of the Mediterranean, is a historic city with well-preserved charm . There are many good reasons to visit this place. It\'s far cooler than the rest of Tunisia in midsummer, it has some of the best restaurants in Tunisia, it\'s one of the few seaside cities of Tunisia and there are many very good beaches close by.</p>\r\n[/vc_column_text][vc_custom_heading text="Discover" font_container="tag:h3|text_align:left"][/vc_column][/vc_row][vc_row][vc_column width="1/2"][vc_column_text]\r\n<p style="text-align: left;"> The central port of Bizerte is a beautiful place. It\'s "defended" from the sea by a double kasbah that is in perfect shape despite the 400 years of age (the  original structure dates back to Byzantine times). The houses at the port are made up of a beautiful mixture of greyish white and pale blue.\r\nYou can also visit \' the old port \'. In fact , in modern times, that is since 1895, a straight and wide canal has connected the Bizerte Lake with the Mediterranean Sea.\r\nOf this today, two fortresses still guard the entrance, the smaller one called ksiba, the larger known by the standard name of kasbah. Both stand out as\r\nvery visually attractive, especially when you throw in the views of the port of the medina as well.</p>\r\n[/vc_column_text][/vc_column][vc_column width="1/2"][vc_column_text]Don\'t forget to explore along the narrow streets of the medina, visit the souks, admire the 17th century Turkish fountain as you walk past. Climb up to the Spanish Fort which dominates the city, to enjoy the view across the harbour. Around the town, you will no doubt have your breath taken away by the lush green landscape of hills, fields of wheat and orchards. For more suprises , don\'t hesitate to visit Sejnane , a small village where you can discover the amazing talent of women in traditionnal pottery.[/vc_column_text][/vc_column][/vc_row]', 'Bizerte', '', 'publish', 'closed', 'closed', '', 'bizerte', '', '', '2017-06-20 18:23:43', '2017-06-20 18:23:43', '', 0, 'http://localhost/testwp/?page_id=95', 0, 'page', '', 0),
