(138, 1, '2017-06-15 02:21:40', '2017-06-15 02:21:40', '{"sydney::header_image":{"value":"http:\\/\\/localhost\\/testwp\\/wp-content\\/uploads\\/2017\\/06\\/cropped-14611149_10206639925750038_1525383254583045129_n.jpg","type":"theme_mod","user_id":1},"sydney::header_image_data":{"value":{"url":"http:\\/\\/localhost\\/testwp\\/wp-content\\/uploads\\/2017\\/06\\/cropped-14611149_10206639925750038_1525383254583045129_n.jpg","thumbnail_url":"http:\\/\\/localhost\\/testwp\\/wp-content\\/uploads\\/2017\\/06\\/cropped-14611149_10206639925750038_1525383254583045129_n.jpg","timestamp":1497493295222,"attachment_id":137,"width":1920,"height":600},"type":"theme_mod","user_id":1}}', '', '', 'trash', 'closed', 'closed', '', '5915790b-b29a-489f-a4ee-6a50d5ff5b22', '', '', '2017-06-15 02:21:40', '2017-06-15 02:21:40', '', 0, 'http://localhost/testwp/index.php/2017/06/15/5915790b-b29a-489f-a4ee-6a50d5ff5b22/', 0, 'customize_changeset', '', 0),
(139, 1, '2017-06-20 18:31:19', '2017-06-20 18:31:19', '[vc_row][vc_column][vc_empty_space][edsanimate_start entry_animation_type= "fadeInDown" entry_delay= "0" entry_duration= "1" entry_timing= "linear" exit_animation_type= "" exit_delay= "" exit_duration= "" exit_timing= "" animation_repeat= "1" keep= "yes" animate_on= "load" scroll_offset= "" custom_css_class= ""][vc_custom_heading text="Bizerte" font_container="tag:h2|text_align:center"][/vc_column][edsanimate_end][/vc_row][vc_row][vc_column][vc_custom_heading text="Bizerte , the smiling coast of Tunisia :" font_container="tag:h4|text_align:center"][vc_column_text]\n<p style="text-align: center;">On the coast of Tunisia , Bizerte, sentinel of the Mediterranean, is a historic city with well-preserved charm . There are many good reasons to visit this place. It\'s far cooler than the rest of Tunisia in midsummer, it has some of the best restaurants in Tunisia, it\'s one of the few seaside cities of Tunisia and there are many very good beaches close by.</p>\n[/vc_column_text][vc_custom_heading text="Discover" font_container="tag:h3|text_align:left"][/vc_column][/vc_row][vc_row][vc_column width="1/2"][vc_column_text]\n<p style="text-align: left;"> The central port of Bizerte is a beautiful place. It\'s "defended" from the sea by a double kasbah that is in perfect shape despite the 400 years of age (the  original structure dates back to Byzantine times). The houses at the port are made up of a beautiful mixture of greyish white and pale blue.\nYou can also visit \' the old port \'. In fact , in modern times, that is since 1895, a straight and wide canal has connected the Bizerte Lake with the Mediterranean Sea.\nOf this today, two fortresses still guard the entrance, the smaller one called ksiba, the larger known by the standard name of kasbah. Both stand out as\nvery visually attractive, especially when you throw in the views of the port of the medina as well.</p>\n[/vc_column_text][/vc_column][vc_column width="1/2"][vc_column_text]Don\'t forget to explore along the narrow streets of the medina, visit the souks, admire the 17th century Turkish fountain as you walk past. Climb up to the Spanish Fort which dominates the city, to enjoy the view across the harbour. Around the town, you will no doubt have your breath taken away by the lush green landscape of hills, fields of wheat and orchards. For more suprises , don\'t hesitate to visit Sejnane , a small village where you can discover the amazing talent of women in traditionnal pottery.[/vc_column_text][/vc_column][/vc_row]', 'Bizerte', '', 'inherit', 'closed', 'closed', '', '95-autosave-v1', '', '', '2017-06-20 18:31:19', '2017-06-20 18:31:19', '', 95, 'http://localhost/testwp/index.php/2017/06/17/95-autosave-v1/', 0, 'revision', '', 0),
